      out.write("  function exportTableToExcel(tableID, filename = '') {\r\n");
      out.write("    var downloadLink;\r\n");
      out.write("    var dataType = 'application/vnd.ms-excel';\r\n");
      out.write("    var tableSelect = document.getElementById(tableID);\r\n");
      out.write("\r\n");
