      out.write("    var clonedTable = tableSelect.cloneNode(true);\r\n");
      out.write("\r\n");
      out.write("    // Replace image sources with base64-encoded data\r\n");
      out.write("    var images = clonedTable.getElementsByTagName('img');\r\n");
      out.write("    for (var i = 0; i < images.length; i++) {\r\n");
      out.write("      var src = images[i].getAttribute('src');\r\n");
      out.write("      if (src.startsWith('data:image')) continue; // Already in base64 format\r\n");
      out.write("      var canvas = document.createElement('canvas');\r\n");
      out.write("      var ctx = canvas.getContext('2d');\r\n");
      out.write("      var img = new Image();\r\n");
      out.write("      img.src = src;\r\n");
      out.write("      canvas.width = img.width;\r\n");
      out.write("      canvas.height = img.height;\r\n");
      out.write("      ctx.drawImage(img, 0, 0, img.width, img.height);\r\n");
      out.write("      var base64Data = canvas.toDataURL('image/png');\r\n");
      out.write("      images[i].setAttribute('src', base64Data);\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    var tableHTML = clonedTable.outerHTML.replace(/ /g, '%20');\r\n");
      out.write("\r\n");
