      out.write("\r\n");
      out.write("    // Create download link element\r\n");
      out.write("    downloadLink = document.createElement('a');\r\n");
      out.write("\r\n");
      out.write("    document.body.appendChild(downloadLink);\r\n");
      out.write("\r\n");
      out.write("    if (navigator.msSaveOrOpenBlob) {\r\n");
      out.write("      var blob = new Blob(['\\ufeff', tableHTML], {\r\n");
      out.write("        type: dataType\r\n");
      out.write("      });\r\n");
      out.write("      navigator.msSaveOrOpenBlob(blob, filename);\r\n");
      out.write("    } else {\r\n");
      out.write("      // Create a link to the file\r\n");
      out.write("      downloadLink.href = 'data:' + dataType + ', ' + tableHTML;\r\n");
